import React from "react";
import { render } from "react-dom";
import { Parallax } from "react-parallax";
import ParticlesBg from "particles-bg";
import { AwesomeButton } from "react-awesome-button";
import Code from "./components/Code.jsx";
import Icons from "./components/Icons.jsx";

import "react-awesome-button/dist/styles.css";
import "./App.css";

import image1 from "./assets/01.jpeg";
import image2 from "./assets/02.jpeg";
import image3 from "./assets/03.jpeg";
import image4 from "./assets/04.jpeg";
import image5 from "./assets/05.jpeg";


const App = () => (
  <div className="main">
    <div className="container">
      <Parallax strength={500}>
      <div style={{ height: 500 }}>
              <div className="boxs header">
                <h1 className="title">adbox</h1>
                <h4 className="introduction">
                   our device allows you to stream ads for money anywhere allowing you to monetize any physical space.
                </h4>
                <div className="buttons">
                  <a href="https://arjunduraivenkatesh.typeform.com/to/vasyoZFx">
                    <AwesomeButton
                      size="medium"
                      type="secondary"
                    >
                      advertisers
                    </AwesomeButton>
                  </a>
                  <div className="space"></div>
                  <a href="https://arjunduraivenkatesh.typeform.com/to/DrOnir">
                    <AwesomeButton
                      size="medium"
                      type="primary"
                    >
                      locations/publishers
                    </AwesomeButton>
              </a>
            </div>
          </div>
        </div>
      </Parallax>
    </div>
  </div>
);

export default App;
